import { 
    Flex,
    Heading
} from '@chakra-ui/react';

const Logo = () => {
    return (
        <Flex
            alignItems="center"
            gap="0.5rem"
            bgColor="#ff8177"
            fontSize={["1rem", "1rem", "1rem", "1.5rem"]}
        >
            <i class="fas fa-hammer"></i>
            <Heading size={['md', 'md', 'md', 'lg']} fontWeight={400}>
                Breakdown
            </Heading>
        </Flex>
    );
}

export default Logo;
